import { useState } from "react"

const useCounter = ()=>{
    const [count,setCount] = useState(0)
    const increment = ()=>{
        setCount(count+1)
    }
    const decrement =()=>{
        setCount(count-1)
    }
    return {
        count:count,
        increment:increment,
        decrement:decre
    }
}
export default useCounter
